B.MU=new A.I(7,{id:1675766541874,question:"What is ClickJacking?",answer:"- **ClickJacking** is a security attack where the user is fooled to click on something while they assume they are clicking another thing. \n- The attack mostly happens by the HTML frames. ClickJacking is also regarded as the user interface redressing. \n- It lets the user think that they are utilising a normal UI in the web page, but in actuality, there is an unseen UI in control; you can think of it as the user interface being redressed.\n-  When users click on one thing, assuming it to be secure and safe, the hidden UI executes another action.\n\n",category:"Web Frontend",topic:"Web Basics",level:0,uploader:"Pankaj Venkata"},B.i,t.M)
B.MJ=new A.I(7,{id:1675766651378,question:"Mention three ways to decrease page load time?",answer:"There are numerous things accountable for lowering page load time. Let us look at the three best ways to reduce its loading time:\n\n- **Image Optimization**: It is always advised to scale your videos and pictures before uploading them to a page.\n- **Browser Cache**: The utilization of cache will boost speed for pages that you have visited already.\n- **Optimize and compress content**: Compressing the content of a website decreases the load time of a page to a great extent.\n- **StyleSheet Reference on Top**: Setting stylesheet reference to the header of a doc allows your page to load quickly.\n",category:"Web Frontend",topic:"Web Basics",level:0,uploader:"Pankaj Venkata"},B.i,t.M)
B.M4=new A.I(7,{id:1675766805669,question:"Tell me when and why should I make use of Webpack?",answer:"- While creating a complicated front-end application with tons of non-code static possessions, for instance, CSS, fonts, images, etc, then, of course, you should make use of Webpack since it has a lot of amazing benefits.\n\n- If you have a small application that doesn't have a lot of static resources and you only have to create one file of JavaScript to help the customers, then Webpack should be more overhead than needed.\n",category:"Web Frontend",topic:"Web Basics",level:0,uploader:"Pankaj Venkata"},B.i,t.M)
B.Mc=new A.I(7,{id:1675766887809,question:"How does the server hanger the page in which content is present in several languages?",answer:'- When an HTTP request is sent to the server by the user, the user browser also sends a chunk of additional information regarding the language preference as the Accept-Language header. \n- Then the server reads the HTTP request with the Accept-Language header and sends the document version back along with the right language and declares the language attribute Lang in the HTML tag.\n\n```\n<html lang = "hi">...</html>\n```\n\n',category:"Web Frontend",topic:"Web Basics",level:0,uploader:"Gobind Sekhar"},B.i,t.M)
