B.Ns=new A.I(7,{id:1675874105069,question:"Explain all components of a Hadoop application.",answer:"- **Hadoop Common**: It is a common set of utilities and libraries that are utilized by Hadoop.\n- **HDFS**: This Hadoop application relates to the file system in which the Hadoop data is stored. It is a distributed file system having high bandwidth.\n- **Hadoop MapReduce**: It is based according to the algorithm for the provision of large-scale data processing.\n- **Hadoop YARN**: It is used for resource management within the Hadoop cluster. It can also be used for task scheduling for users.\n\n![hadoop](https://i.postimg.cc/P5QS6xdw/Hadoonh-3-640x398.png)",category:"Data Engineer",topic:"Hadoop",level:0,uploader:"Narayana Kailash"},B.i,t.M)
B.MF=new A.I(7,{id:1675874226928,question:"Do you have any experience in building data systems using the Hadoop framework?",answer:"- If you have experience with Hadoop, state your answer with a detailed explanation of the work you did to focus on your skills and tool's expertise. You can explain all the essential features of Hadoop\n- . For example, you can tell them you utilized the Hadoop framework because of its scalability and ability to increase the data processing speed while preserving the quality.\n\nSome features of Hadoop include: \n\n- It is Java-Based. Hence, there may be no additional training required for team members. Also, it is easy to use. \n- As the data is stored within Hadoop, it is accessible in the case of hardware failure from other paths, which makes it the best choice for handling big data. \n- In Hadoop, data is stored in a cluster, making it independent of all the other operations.\n\n> **Tip**: In case you have no experience with this tool, learn the necessary information about the tool's properties and attributes.",category:"Data Engineer",topic:"Hadoop",level:0,uploader:"Narayana Kailash"},B.i,t.M)
B.Mh=new A.I(7,{id:1675874288433,question:"What is NameNode? What happens if NameNode crashes or comes to an end?\n",answer:"- It is the centre-piece or central node of the Hadoop Distributed File System(HDFS), and it does not store actual data. It stores metadata.\n-  For example, the data being stored in DataNodes on which rack and which DataNode the information is stored. \n- It tracks the different files present in clusters. Generally, there is one NameNode, so when it crashes, the system may not be available.",category:"Data Engineer",topic:"Hadoop",level:0,uploader:"Narayana Kailash"},B.i,t.M)
B.Mw=new A.I(7,{id:1675874759426,question:"Can you elaborate on Reducer in Hadoop MapReduce? Explain the core methods of Reducer?",answer:"**Reducer** is the second stage of data processing in the Hadoop Framework. The Reducer processes the data output of the mapper and produces a final output that is stored in HDFS. \n\nThe Reducer has 3 phases:\n\n- **Shuffle**: The output from the mappers is shuffled and acts as the input for Reducer.\n- **Sorting** is done simultaneously with shuffling, and the output from different mappers is sorted. \n\n- **Reduce**: in this step, Reduces aggregates the key-value pair and gives the required output, which is stored on HDFS and is not further sorted.\n\n\nThere are three core methods in Reducer:\n\n- **Setup** : it configures various parameters like input data size.\n- **Reduce** : It is the main operation of Reducer. In this method, a task is defined for the associated key.\n- **Cleanup**: This method cleans temporary files at the end of the task.\n",category:"Data Engineer",topic:"Hadoop",level:1,uploader:"Narayana Kailash"},B.i,t.M)
B.M6=new A.I(7,{id:1675874843330,question:"How can you deploy a big data solution?",answer:"The steps involved are:\n\n- **Data Integration/Ingestion**: In this step, the extraction of data using data sources like RDBMS, Salesforce, SAP, MySQL is done.\n- **Data storage**: The extracted data would be stored in an HDFS or NoSQL database.\n- **Data processing**: the last step should be deploying the solution using processing frameworks like MapReduce, Pig, and Spark.\n",category:"Data Engineer",topic:"Big Data",level:0,uploader:"Mitul Aryan"},B.i,t.M)
B.MD=new A.I(7,{id:1675874929243,question:"What are the steps that occur when Block Scanner detects a corrupted data block?",answer:"Following are the steps that occur when Block Scanner find a corrupted data block:\n\n1) First of all, when Block Scanner find a corrupted data block, DataNode report to NameNode\n\n2) NameNode start the process of creating a new replica using a replica of the corrupted block.\n\n3) Replication count of the correct replicas tries to match with the replication factor. If the match found corrupted data block will not be deleted.",category:"Data Engineer",topic:"Hadoop",level:0,uploader:"Mitul Aryan"},B.i,t.M)
B.MY=new A.I(7,{id:1675874999944,question:"What are four V\u2019s of big data?",answer:"The four V\u2019s of big data are:\n\n- **Velocity**\n- **Variety**\n- **Volume**\n- **Veracity**",category:"Data Engineer",topic:"Big Data",level:0,uploader:"Mitul Aryan"},B.i,t.M)
B.N4=new A.I(7,{id:1675875084441,question:"Explain the use of Hive in Hadoop eco-system.",answer:"- Hive provides an interface to manage data stored in Hadoop eco-system. \n- Hive is used for mapping and working with HBase tables.\n-  Hive queries are converted into MapReduce jobs in order to hide the complexity associated with creating and running MapReduce jobs.",category:"Data Engineer",topic:"Hive",level:0,uploader:"Mitul Aryan"},B.i,t.M)
B.LN=new A.I(7,{id:1675875125323,question:"Explain how .hiverc file in Hive is used.",answer:"- In Hive, .hiverc is the initialization file.\n- This file is initially loaded when we start Command Line Interface (CLI) for Hive. \n- We can set the initial values of parameters in .hiverc file.",category:"Data Engineer",topic:"Hive",level:0,uploader:"Mitul Aryan"},B.i,t.M)
B.Mp=new A.I(7,{id:1675875222365,question:"What is COSHH?",answer:"**Classification and Optimization-based Scheduling for Heterogeneous Hadoop Systems**(COSHH), as the name implies, enables scheduling at both the cluster and application levels to have a direct positive impact on task completion time.\n\n",category:"Data Engineer",topic:"Hadoop",level:0,uploader:"Mitul Aryan"},B.i,t.M)
B.ML=new A.I(7,{id:1675875316968,question:"What are Skewed tables in Hive?",answer:"- Skewed tables are a type of table in which some values in a column appear more frequently than others.\n- The distribution is skewed as a result of this. \n- When a table is created in Hive with the SKEWED option, the skewed values are written to separate files, while the remaining data are written to another file.",category:"Data Engineer",topic:"Hive",level:0,uploader:"Mitul Aryan"},B.i,t.M)
